import { jsPDF } from 'jspdf'

const font =
  ''

const addFonts = () => {
  const jsPDFInstance = jsPDF as any
  jsPDFInstance.API.events.push([
    'addFonts',
    function () {
      //  @ts-ignore
      this.addFileToVFS('Poppins-Medium.ttf', font)
      //  @ts-ignore
      this.addFont('Poppins-Medium.ttf', 'Poppins', 'normal')
    },
  ])
}

addFonts()

export {}
